import { useState } from "react";


export default function App3() {
    return(
        <>
    <MyButton/>
    <MyButton/>
    </>
    );
}

function MyButton(){
    const [count,setCount] = useState(0);
    function handleClick(){
        setCount(count+1);
    }
    return(
        <button onClick={handleClick}>
            Clicked{ count} times
        </button>
    )
}
